import React from 'react';
import "./Signature.css";

const Signature = (props) => {
    const {name, email, phone, position} = props
    const HOST_IMG = "https://cosmodern.vn"
    const defaultValue = {
        name: "Your Name",
        email: "e.mail@cosmodern.vn",
        phone: "+84123456789",
        position: "Cosmodern Executive"
    }

    function selectElementContents(el) {
        var body = document.body, range, sel;
        if (document.createRange && window.getSelection) {
            range = document.createRange();
            sel = window.getSelection();
            sel.removeAllRanges();
            try {
                range.selectNodeContents(el);
                sel.addRange(range);
            } catch (e) {
                range.selectNode(el);
                sel.addRange(range);
            }
            document.execCommand("copy");
            console.log(range);
            alert("Copied successfully!");
        } else if (body.createTextRange) {
            range = body.createTextRange(el);
            range.moveToElementText(el);
            range.select();
            range.execCommand("Copy");
            alert("Copied successfully!");
        }
    }

    return (
        <div style={{ width: "100%" }} >
            <table id="myTable" width="100%" style={{ width: "420px"}}>
                <tbody>
                    <tr>
                        <td maxWidth="35px"></td>
                    </tr>
                    <tr>
                        <td colSpan={9} style={{fontWeight:700, fontSize: 18, color: "#ffffff", textTransform: "uppercase"}}>
                            {name ? name : defaultValue.name}
                        </td>
                        <td colSpan={3} align="right">
                            <a href="https://cosmodern.vn" target="_blank" rel="noopener noreferrer"><img style={{ marginTop: "4px" }} src="https://cosmodern.vn/public/uploads/all/UhkdXVe9cAz2QZJbf88PO1NvpW9mOhevItgjnkeM.jpg" alt="logo-home" width = "93px" height = "16px" /></a>
                        </td>
                    </tr>
                    <tr>
                        <td colSpan={12} style={{fontSize: 12, color: "#ffffff", textTransform: "uppercase"}} >
                            {position ? position : defaultValue.position}
                        </td>
                    </tr>
                    <tr>
                        <td colSpan={12} style={{fontSize: 12, color: "#ffffff", textTransform: "uppercase"}} >
                            {email ? email : defaultValue.email}
                        </td>
                    </tr>
                    <tr>
                        <td colSpan={12} style={{paddingBottom: "15px", fontSize: 12, borderBottom: "1px solid #ffffff", color: "#ffffff", textTransform: "uppercase"}} >
                            {phone ? phone : defaultValue.phone}
                        </td>
                    </tr>
                    <tr style={{fontSize: 12, color: "#ffffff"}}>
                        <td colSpan={1} style={{ paddingTop: "10px"}}>
                            <b>Ho Chi Minh City</b>
                        </td>
                        <td colSpan={11} style={{ paddingTop: "10px"}}>
                            <strong>Toong Vo Thi Sau</strong><>188 Vo Thi Sau, Vo Thi Sau Ward, District 3</>
                        </td>
                    </tr>
                    <tr>
                        <td colSpan={1} width="55px">
                            <a target="_blank" rel="noopener noreferrer" href="https://cosmodern.vn/"><img width="30px" src={"https://scontent.fsgn5-11.fna.fbcdn.net/v/t39.30808-6/312165764_202694652117322_5257094347470535686_n.jpg?_nc_cat=111&ccb=1-7&_nc_sid=09cbfe&_nc_ohc=dtQFRmpVgLYAX9CHC0Z&_nc_ht=scontent.fsgn5-11.fna&oh=00_AfB-E4y8x83rK31TjlOsKzbON0AFQwGtc0zIPG4CJaTz6w&oe=6409FFB6"} alt="logo-cosmodern" /></a>
                        </td>
                        <td colSpan={1} width="55px">
                            <a target="_blank" rel="noopener noreferrer" href="https://www.instagram.com/cosmodern.official/"><img  width="30px" src={"https://cdn-icons-png.flaticon.com/512/1384/1384015.png"} alt="logo-cosmodern-ig" /></a>
                        </td>
                        <td colSpan={1} width="55px">
                            <a target="_blank" rel="noopener noreferrer" href="https://www.facebook.com/cosmodern.official"><img  width="30px" src={"https://cdn-icons-png.flaticon.com/512/59/59439.png"} alt="logo-cosmodern-fb" /></a>
                        </td>
                        <td colSpan={1} width="55px">
                            <a target="_blank" rel="noopener noreferrer" href="https://www.linkedin.com/company/cosmodern-official/"><img width="30px" src={"https://cdn-icons-png.flaticon.com/512/61/61109.png"} alt="logo-cosmodern-linkedin" /></a>
                        </td>
                        <td colSpan={8}></td>
                    </tr>
                    
                </tbody>

            </table>
        </div>
    )
}
